    """ From Nov17Mad_BaseStan_nom with epsn[0,1] = 3.0 um, and adjusted phi[0,1] (= 496 urad, approx 500 urad) and oncc[0,1] (= 0.77). With a growth rate from CCs of 0.07 um/h = 2.33%/h for 3.0um (at 15cm, 380urad).
    The value of sepLR[0,1] has to be moderately decreased (= 9.6) to limit phi[0,1] to the aforementioned value, otherwise phi[0,1] = 544 urad (and oncc[0,1] = 0.70) due to the larger emittance """
    self._epsn[0]       = 3.0e-6
