    self._sepLR[1]      = self._sepLR[0]
    #self._sepLR[2] remains the same
    self._oncc[0]       = 380e-6/(self._sepLR[0]*np.sqrt(self._epsn[0]/(self._momeV/cst.pmass)/self._beta[0][0])) # = 0.7657
    self._oncc[1]       = self._oncc[0]
    #self._oncc[2] remains the same
    self._tau_cc        = 1./( (0.07e-6/self._epsn[0]) * (0.15/380e-6**2)) # 0.07e-6/3.0e-6 = 2.3333%
    pass

